import{_ as A}from"./chunks/bob-rebrand.211bb4c0.js";import{_ as o}from"./chunks/waypoint_marker.33d9dbbc.js";import{_ as e}from"./chunks/enchant_table.5c1b457c.js";import{_ as B,o as t,c as a,Q}from"./chunks/framework.a7175731.js";const g="/assets/bounty_board.3d513a3d.png",d="data:image/png;base64,",u=JSON.parse('{"title":"Better on Bedrock Block Wiki","description":"","frontmatter":{},"headers":[],"relativePath":"Main/Wiki/blocks.md","filePath":"Main/Wiki/blocks.md"}'),n={name:"Main/Wiki/blocks.md"},r=Q('<h1 id="better-on-bedrock-block-wiki" tabindex="-1">Better on Bedrock Block Wiki <a class="header-anchor" href="#better-on-bedrock-block-wiki" aria-label="Permalink to &quot;Better on Bedrock Block Wiki&quot;">​</a></h1><p>Need help with how to use a block or how to find them along with their uses? This wiki has your back. Select the topic you want from the sidebar or search the block name!</p><p><strong>Note</strong>: <u>When the wiki refers to <code>Use</code> or <code>Interact</code>, keep in mind that it refers to <code>right-click</code>, <code>LT/L2</code>, <code>Tap</code>. </u></p><p><img src="'+A+'" alt="image"></p><h2 id="bounty-board" tabindex="-1">Bounty Board <a class="header-anchor" href="#bounty-board" aria-label="Permalink to &quot;Bounty Board&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+g+'" alt="Example Image" width="64"></div><h3 id="info" tabindex="-1">Info <a class="header-anchor" href="#info" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Bounty Board is a block that is provides a Bounty Scroll. This block can not be mined or obtained. This block is found inside of a trader outpost, which is a rare structure in the overworld.</p><h2 id="waystone" tabindex="-1">Waystone <a class="header-anchor" href="#waystone" aria-label="Permalink to &quot;Waystone&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+d+'" alt="Example Image" width="64"></div><h3 id="info-1" tabindex="-1">Info <a class="header-anchor" href="#info-1" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>Waystones are a neat way for players to travel from point A to point B. It costs XP to travel from one Waystone to another, and extra XP if you travel across dimensions.</p><h3 id="how-to-use" tabindex="-1">How to use <a class="header-anchor" href="#how-to-use" aria-label="Permalink to &quot;How to use&quot;">​</a></h3><p>Waystones can be toggled to either be global or private. Global means if Waystone A was saved with &quot;Global&quot; being enabled, anyone in that world will see the Waystone, and they would be able to teleport to it, which is honestly pretty great for multiplayer worlds!</p><div style="display:flex;align-items:center;"><img src="'+o+'" alt="Example Image" width="64"></div><p>The Waystone Key can also be used to access the Waystone menu from any location in the world.</p><h3 id="how-to-find" tabindex="-1">How to find <a class="header-anchor" href="#how-to-find" aria-label="Permalink to &quot;How to find&quot;">​</a></h3><p>This block is found inside a Waystone Tower or Crafting.</p><h2 id="miner-bench" tabindex="-1">Miner Bench <a class="header-anchor" href="#miner-bench" aria-label="Permalink to &quot;Miner Bench&quot;">​</a></h2><div style="display:flex;align-items:center;"><img src="'+e+'" alt="Example Image" width="128"></div><h3 id="info-2" tabindex="-1">Info <a class="header-anchor" href="#info-2" aria-label="Permalink to &quot;Info&quot;">​</a></h3><p>The Miner Bench is a block that allows you to add custom enchantments to your tools. Each enchanted book is labelled the tool it can be added to.</p><h3 id="how-to-use-1" tabindex="-1">How to use <a class="header-anchor" href="#how-to-use-1" aria-label="Permalink to &quot;How to use&quot;">​</a></h3><p>To use the Miner Bench, you need to hold either a <code>pickaxe</code>, <code>axe</code>, <code>hoe</code> or <code>shears</code> and use the block. This will prompt a UI with instructions to follow.</p><h3 id="how-to-find-1" tabindex="-1">How to find <a class="header-anchor" href="#how-to-find-1" aria-label="Permalink to &quot;How to find&quot;">​</a></h3><p>This block is found via Crafting</p>',26),i=[r];function E(I,s,c,l,h,C){return t(),a("div",null,i)}const p=B(n,[["render",E]]);export{u as __pageData,p as default};
